import React, { useState } from 'react';
import axios from 'axios';

function App() {
  const [file, setFile] = useState(null);
  const [status, setStatus] = useState('Idle');
  const [assetID, setAssetID] = useState('');
  const apiToken = 'eyJhbGciOiJSUzI1NiIsInR5cCIgOiAiSldUIiwia2lkIiA6ICJuSnVpYzVwbXk1T1hGSjVmY1RIQTdUNVktRHZVbVVOR2xxVHBqS0hDVnU4In0..S3IczebA29xE6mfDgi-LuHW5wSyF_mF_6T282FlGlo6c2w-ZPW6mabXUVevPFgzrEClATHC6Emu_MsnZZy6ZpdwPRgNanTijWXy1hSLgVyujOWsQSfhFvAifvIBoc_60pREW0NTAudVNYOWJO2NX3mUr4lAp0h-3hpwdnql2vNyeyiGE98_lKdiMh9b4JWwoe0gKaeMcHDI-mad0m54aFeNXeuzzAnQ3IrwoYe8YYMQCt9rdDlqD4CSW_76ozKhFLCor2gBXa4qnXri72B8SRJOC7elUa7jSAaCEL0bQxDmbdyRuRkNGDE4vwNayO6jXLLZzyOhbCcJlhWkqFgXNDA'; // Place your API token here

  const handleFileChange = (event) => {
    setFile(event.target.files[0]);
  };

  const createAvatar = async () => {
    setStatus('Creating Avatar...');
    try {
      // Assuming avatar creation requires initial parameters according to your API description
      const avatarDetails = {
        avatarname: "test",
        gender: "FEMALE",
        height: 185,
        imageMode: "AFI",
        weight: 85
      };
      const response = await axios.post('https://api.meshcapade.com/api/v1/avatars/create/from-images', avatarDetails, {
        headers: { 'Authorization': `Bearer ${apiToken}` },
      });
      const newAssetID = response.data.data.id; // Adjust according to the actual API response structure
      setAssetID(newAssetID);
      setStatus('Avatar Created');
      return newAssetID;
    } catch (error) {
      console.error('Error creating avatar:', error);
      setStatus('Error Creating Avatar');
      return null;
    }
  };

  const uploadImage = async (assetID, file) => {
    setStatus('Uploading Image...');
    try {
      const formData = new FormData();
      formData.append('file', file);
      // First, get the image upload URL by linking the image asset with the avatar
      const uploadResponse = await axios.post(`https://api.meshcapade.com/api/v1/avatars/${assetID}/images`, formData, {
        headers: { 'Authorization': `Bearer ${apiToken}`, 'Content-Type': 'multipart/form-data' },
      });
      // Assuming the upload process is successful based on your API, adjust as necessary
      console.log('Image uploaded successfully');
      setStatus('Image Uploaded');
    } catch (error) {
      console.error('Error uploading image:', error);
      setStatus('Error Uploading Image');
    }
  };

  const startFittingProcess = async (assetID) => {
    setStatus('Starting Fitting Process...');
    const requestBody = {
      avatarname: "test", // You might want to make this dynamic or user-defined
      gender: "FEMALE", // Adjust accordingly
      height: 185, // Adjust accordingly
      imageMode: "AFI", // Adjust accordingly, based on your specific use case
      weight: 85 // Adjust accordingly
    };

    try {
      await axios.post(`https://api.meshcapade.com/api/v1/avatars/${assetID}/fit-to-images`, requestBody, {
        headers: { 'Authorization': `Bearer ${apiToken}` },
        'Content-Type': 'application/json' // Ensure you're specifying the content type
      });
      setStatus('Fitting Process Started');
    } catch (error) {
      console.error('Error starting fitting process:', error);
      setStatus('Error Starting Fitting Process');
    }
  };


  const handleSubmit = async (event) => {
    event.preventDefault();
    if (!file) {
      alert('Please select a file.');
      return;
    }

    const createdAssetID = await createAvatar();
    if (createdAssetID) {
      await uploadImage(createdAssetID, file);
      await startFittingProcess(createdAssetID);
      // Consider implementing a polling mechanism here to check the status of the fitting process
    }
  };

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <input type="file" onChange={handleFileChange} />
        <button type="submit">Upload and Create Avatar</button>
      </form>
      <div>Status: {status}</div>
      {assetID && <div>Asset ID: {assetID}</div>}
    </div>
  );
}

export default App;
